// our mesmerising @dameimfala makes a come back this year to play with the idea of ‘drag as resilience’.

Dame Imfala is a trans non-binary drag artist and model hailing from Imphal, currently based in Mumbai. Their art is a celebration of Meitei heritage, a culmination of tradition and contemporary creativity that challenges cultural and gender norms. With a background in fashion design, their signature style is a kaleidoscope of Meitei aesthetics, avant-garde drag expression and sartorial splendor. Dame Imfala has graced stages across the country, captivating audiences with performances that transcend cultural boundaries. They’ve been featured in India’s leading fashion magazines like Vogue, GQ, Grazia, and walked the runway for acclaimed designers. They continue to push the boundaries of drag and fashion as a form of artistic rebellion, with an unwavering dedication to authenticity and self-expression.

